import { StyleSheet } from "react-native";
import Constants from "expo-constants";

export default StyleSheet.create({
  fundo:{
    backgroundColor:'yellow',
    position:'absolute',
    left:20,
    right:20,
    top:20,
    bottom:20,
    width:'100vh'

  },
  container: {
    flex: 1,
    backgroundColor: 'blue',
    alignItems: 'center',
    paddingTop:20,
    borderRadius:15,
    borderTopLeftRadius:15,
    borderTopRightRadius:15,
    paddingBottom:20
  },
  input: {
    borderColor: 'red',
    backgroundColor: 'white',
    width: "50%",
    borderRadius: 10,
    borderWidth: 1,
    height: 45, textAlign: 'center',
  },
  background: {
    position: 'absolute',
    left: 0,
    right: 0,
    top: 70,
    height: 300,
    borderRadius:50,
    
  },
  botao:{
    borderRadius:20,
    backgroundColor:'#45435',
    width:"100%"
  }
});
